The Whip ChamberTWC - Jan 21, 2013 - Belle Noire



Mp4 + Pics

Belle wants to be freed from the cage, and sometimes you get what you wish for as she is then placed in the room with her hands cuffed and chained overhead. Ogre then cuffs her feet in a spreader bar, and suddenly the cage seems like a comfortable space as she is taught the ways of the whip and cane. Her lovely body is the canvas and her Master's whip is the brush as Belle is rudely ushered into The Whip Chamber


